import React from 'react';
import { Link } from 'react-router-dom';

const MyMenu = () => {
    return (
        <div>
            <Link to="/my-recipes">My menu</Link>
            <Link to="/add-recipe">Add recipe</Link>
            <Link to="/schedule">Schedule</Link>
            <Link to="/plan">Plan</Link>
        </div>
    );
};

export default MyMenu;
